import React, { useState } from "react";
import { Link } from "react-router-dom";
import ModalVideo from "react-modal-video";

function Videos() {
  const [isOpen, setIsOpen] = useState(false);

  return (
    <div className="maincontainer">
      <div className="headline">
        <span>Videos</span>
      </div>
      {/* //////////start modal///////////// */}
      <ModalVideo
        channel="youtube"
        isOpen={isOpen}
        videoId="LQnAnxNkIrk"
        onClose={() => {
          setIsOpen(false);
        }}
      />
      {/* ----------end modal-------------- */}

      <div className="viddiv" onClick={() => setIsOpen(!isOpen)}>
        <Link to="/videos/?vid=LQnAnxNkIrk">
          <img
            alt="pic"
            src="//i1.ytimg.com/vi/LQnAnxNkIrk/mqdefault.jpg"
            className="img-responsive"
            onClick={() => setIsOpen(true)}
          />
        </Link>
        <p className="galeritext">
          Cocktailbar Casablanca bei Gilani≈õ Auf Livestyle Teil1: Equipment
        </p>
        {/* <p className="galeritext">{`${drink.cname} Lernvideo`}</p> */}
      </div>

      <div>
        <button className="btngreen" type="submit">
          <Link
            to="/suche"
            className="Pagelink"
            onClick={() =>
              window.scroll({ top: 0, left: 0, behavior: "smooth" })
            }
          >
            Cocktail Generator
          </Link>
        </button>
      </div>
    </div>
  );
}

export default Videos;
